import { useEffect, useState } from 'react';

const Home = () => {
	const [workouts, setWorkouts] = useState([]);

	useEffect(() => {
		fetch('/api/workouts')
			.then((res) => res.json())
			.then((data) => setWorkouts(data));
	}, []);
	console.log(workouts);

	return <div className='home'>Home</div>;
};

export default Home;
